angular.module("myApp",[]).controller("SignupController",["$scope",function(e){e.checkboxModel={value:!0},e.birthdate={value:null},e.submit=function(){var a=e.birthdate.value,t=new Date,l=t.getFullYear()-a.getFullYear(),r=t.getMonth()-a.getMonth();(r<0||0===r&&t.getDate()<a.getDate())&&l--,e.checkboxModel.value&&l>=18?(e.IsMatch=!0,alert("Successfully registered!")):(e.IsMatch=!1,alert("Please make sure you are already 18 years of age."))}}]);